import React, { Component } from 'react';
import logo from './logo.svg';
import * as Semantic from 'semantic-ui-react';

class PatientView extends Component {
  render() {
    return (
      <div className="App">
        Patient's View
        <Semantic.Menu>
            Sample view
        </Semantic.Menu>
      </div>
    );
  }
}

export default PatientView;
